// ==UserScript==
// @name          Ctrl + Alt + F 으로 파비콘 주소 + 파비콘 Base64 주소 얻기
// @namespace     Ctrl + Alt + F 으로 파비콘 주소 + 파비콘 Base64 주소 얻기
// @match        *://*/*
// @version       0.1
// @description   Ctrl + Alt + F 으로 사이트의 파비콘 주소 + 파비콘 Base64 주소를 얻을 수 있습니다. 파비콘이 ico가 아닌 사이트에서는 얻을 수 없습니다.
// @icon          data:image/jpeg;base64,
// @author        mickey90427 <mickey90427@naver.com>
// @downloadURL https://update.greasyfork.org/scripts/460932/Ctrl%20%2B%20Alt%20%2B%20F%20%EC%9C%BC%EB%A1%9C%20%ED%8C%8C%EB%B9%84%EC%BD%98%20%EC%A3%BC%EC%86%8C%20%2B%20%ED%8C%8C%EB%B9%84%EC%BD%98%20Base64%20%EC%A3%BC%EC%86%8C%20%EC%96%BB%EA%B8%B0.user.js
// @updateURL https://update.greasyfork.org/scripts/460932/Ctrl%20%2B%20Alt%20%2B%20F%20%EC%9C%BC%EB%A1%9C%20%ED%8C%8C%EB%B9%84%EC%BD%98%20%EC%A3%BC%EC%86%8C%20%2B%20%ED%8C%8C%EB%B9%84%EC%BD%98%20Base64%20%EC%A3%BC%EC%86%8C%20%EC%96%BB%EA%B8%B0.meta.js
// ==/UserScript==

document.addEventListener('keydown', function(e) {
    if (e.ctrlKey && e.altKey && e.code === 'KeyF') {
        var favicon = document.querySelector('link[rel="shortcut icon"]');
        if (!favicon) favicon = document.querySelector('link[rel="icon"]');
        if (favicon) {
            var faviconUrl = favicon.href.replace(/[?#].*$/, '');
            var canvas = document.createElement('canvas');
            var img = document.createElement('img');
            img.crossOrigin = 'anonymous';
            img.src = faviconUrl;
            img.onload = function() {
                canvas.width = img.width;
                canvas.height = img.height;
                var context = canvas.getContext('2d');
                context.drawImage(img, 0, 0);
                var faviconImage = canvas.toDataURL('image/png');
                var clipboardText = faviconUrl + '\n' + faviconImage;
                GM_setClipboard(clipboardText);
                alert('Favicon URL and image copied to clipboard!');
            };
        } else {
            alert('Favicon not found.');
        }
    }
});
